/*Table structure for table `kill_order` */

DROP TABLE IF EXISTS `kill_order`;

CREATE TABLE `kill_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '秒杀订单ID',
  `user_id` bigint(20) NOT NULL COMMENT '用户ID',
  `order_id` bigint(20) NOT NULL COMMENT '订单ID',
  `goods_id` bigint(20) NOT NULL COMMENT '商品ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK_userId_goodsId` (`user_id`,`goods_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `kill_order` */

/*Table structure for table `kill_user` */

DROP TABLE IF EXISTS `kill_user`;

CREATE TABLE `kill_user` (
  `id` bigint(20) NOT NULL COMMENT '用户ID(用户手机号码)',
  `nickname` varchar(50) NOT NULL COMMENT '昵称',
  `password` varchar(50) NOT NULL COMMENT '密码(MD5(MD5(pass明文 + 固定salt)) + salt）',
  `salt` varchar(10) DEFAULT NULL,
  `head_image` varchar(128) DEFAULT NULL COMMENT '头像',
  `last_login_date` datetime DEFAULT NULL COMMENT '上次登录时间',
  `login_count` int(10) DEFAULT NULL COMMENT '登录次数',
  `create_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

